import React from "react";
import { Container } from "./styles";

const HomePage = () => {
  return (
    <Container>
      <div className="left-content">
        <h1 className="logo archivo">Dink Url shortner</h1>
        <h3>URLs made short and sweet</h3>
        <p>
          Get your url in seconds. Copy and paste the url here and we will give
          you a short and sweet one. All for 0$
        </p>
        <input placeholder="Paste your link here..." />
      </div>
      <div className="right-content">
        <img
          className="hero-image"
          src={require("../../images/hero-image.png")}
          alt="hero-image"
        />
      </div>
    </Container>
  );
};

export default HomePage;
